import React, { } from 'react';
import '../index.css';
import Navbar from './navbar';
import Footbar from './footer';
import { Card } from 'react-bootstrap';


const Home = () => {


  return (
        <><Navbar />
        <Card style={{"width":"500px",margin:10, padding:20}} > 
            Hello, User!
            <center>
            <div style={{"width":"50%" ,"backgroundColor": "#a6b0bf", "padding":50}} className="row">
                <Card style={{margin:10, padding:20}}>
                <div className="col" class="align-middle" style={{margin:"10px" , "borderColor": "white","width": "45%"}}><span class="align-middle">Experiment</span></div>
                </Card>
                <div className="col" class="align-middle" style={{margin:"10px" , "borderColor": "white","width": "45%"}}><span class="align-middle">Experiment</span></div>
                <div className="col" class="align-middle" style={{margin:"10px" , "borderColor": "white","width": "45%"}}><span class="align-middle">Classroom</span></div>
            </div>
            <div style={{"width":"50%" ,"backgroundColor": "#a6b0bf", "padding":50}} className="row">
                <div className="col" class="align-middle" style={{margin:"10px" , "borderColor": "white","width": "45%"}}><span class="align-middle">Market</span></div>
                <div className="col" class="align-middle" style={{margin:"10px" , "borderColor": "white","width": "45%"}}><span class="align-middle">Developme</span></div>
            </div>
            </center>
        </Card>

        <Footbar /></>
    )
};

export default Home
